import data from "../../../data/navBar.json";

const NavBar = (props) => {
  return (
    <div>
      <ul>
        {data.map((item, index) => {
          <li key={index} className={item.active ? "active" : ""}>
            <i className={`fas${item.icon}`}></i>
          </li>;
        })}
      </ul>
    </div>
  );
};
export default NavBar;
